import React from "react";
import styled from "styled-components";

const LocalMapInfo = () => {

    return(<>
        <InfoUl>
            <li>
                <div><label>진료소 A</label></div>
                <InfoDiv></InfoDiv>
            </li>
        </InfoUl>
    </>)
}

export default LocalMapInfo

const InfoDiv = styled.div`
    width: 400px;
    height: 400px;
    border: solid 1px black;
`

const InfoLi = styled.ul`
    line-style: none;
`
